import logo from './logo.svg';
import './App.css';
import Register from "./pages/Register"
import "./index.css"
import {BrowserRouter, Routes, Route, Redirect } from 'react-router-dom'
import Dashboard from './pages/Dashboard';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={Dashboard}>
          <Dashboard></Dashboard>
        </Route>
        <Route path="/register">
          <Register></Register>
        </Route>

      </Routes>

    </BrowserRouter>
  );
}

export default App;
